import React from "react";
import coverImage from "../../assets/keyboard.jpg";

function Nav() {

  return (
    <header>

      <h2>
        <a href="/">Paul's Web Development Portfolio</a>
      </h2>
      <nav>
        <ul className="flex-row">
          <li className="mx-2">
            <a href="#about">About me</a>
          </li>
          <li>
            <span>Contact</span>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Nav;
